	function semverCompare(current, latest) {
	    if (current.startsWith(latest + '-'))
	        return -1;
	    if (latest.startsWith(current + '-'))
	        return 1;
	    return current.localeCompare(latest, undefined, { numeric: true, sensitivity: 'case', caseFirst: 'upper' }) === -1;
	}
